import React from "react";

const HomePage = () => {
  return (
    <div className="w-11/12 flex items-center  pt-6  ">
      <div className="w-6/12 space-y-5 border">
        <div className="w-11/12 flex justify-center border">
          <span className="w-6/12 flex justify-center border text-4xl font-thin  text-orange-800 ">
            Welcome to your <br /> professional society!
          </span>
        </div>

        <div className="w-11/12 border justify-center flex ">

          <input
            id="idValue"
            name="idValue"
            className=" w-6/12 h-12 p-5 border-orange-400 border text-gray-500 rounded focus:outline-orange-600"
          ></input>
        </div>

      </div>
    </div>
  );
};

export default HomePage;
